public class ImplementStr{
	public static int ImplementStr(String hayStack,String needle){
		if ( hayStack == null || needle == null){
			return -1;
		}
		int iHPoint = 0,iNPoint = 0;
		while (iHPoint < hayStack.length() && iNPoint < needle.length()){
			if(hayStack.charAt(iHPoint) == needle.charAt(iNPoint)){
				++iNPoint;
			}
			else{
				if (iNPoint != 0){
					iHPoint-=iNPoint;
				}
				iNPoint = 0;
			}
			++iHPoint;
		}

		if(iNPoint == needle.length()){
			return iHPoint - iNPoint;
		}
		else{
			return -1;
		}
	}
	public static void main(String[] args){
		if(ImplementStr("",
"") == 4){
			System.out.println("success");
		}
		else{
			System.out.println("fail");
		}
	}
}